import React from 'react';
import courses from './data/courses';

const Courses = () => {
  return (
    <>
      <h1>Courses</h1>
      <ul>
        {courses.map((course) => (
          <li key={course.id}>
            <h2>{course.title}</h2>
            <p>{course.description}</p>
          </li>
        ))}
      </ul>
    </>
  );
};

export default Courses;
